import { Routes, Route } from 'react-router-dom';

import NavBar from './routing/navigation/navigation.component';
import Home from './routing/home/home.component';
import SignIn from './routing/authentication/authentication.component';
import Shop from './routing/shop/shop.component';

const App = () => {
	return (
		<Routes>
			<Route
				path="/"
				element={<NavBar />}>
				<Route
					index
					element={<Home />}
				/>
				<Route
					path="shop"
					element={<Shop />}
				/>
				<Route
					path="Authentication"
					element={<SignIn />}
				/>
			</Route>
		</Routes>
	);
};

export default App;
